let {WxComponents, WebHookConstants} =  require('../constants');
let BaseContainer                    = require('./base/BaseContainer');

class Tabs extends BaseContainer {

    static init(param) {
        return new Tabs(param);
    }

    constructor(param) {
        super(param);
        this.config = {'type': WxComponents.TABS};
    }

}

module.exports = Tabs;
